import React from "react";
import InputLogin from "./UI/login/inputlogin";
import MyButton from "./UI/button/mybutton";

const Login = () => {
    return (
        <div className="login">
                <h3>Вход и регистрация</h3>
                <InputLogin
                    type="text"
                    placeholder='Имя пользователя'
                />
                <InputLogin 
                    type="text"
                    placeholder='Пароль'
                 />
                <MyButton>
                    Вход
                </MyButton>
            </div>
    )
}

export default Login
